import { useEffect, useState } from 'react';
import './App.css';
import Header from './components/header'; 

export default function App() {

  const [backendData, setBackendData] = useState([{}])

  useEffect(() => {
    fetch('/server').then(
      res => console.log()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  })

  return (
    <Header />
  );
}
